n_qubits = 148
print(f"Number of stabilizers: {len(stabilizers)}")
print(f"Qubit count: {n_qubits}")

# Use stim to generate circuit
import stim

# Convert to PauliStrings
pauli_strs = []
for s in stabilizers:
    pauli_strs.append(stim.PauliString(s))

# Try to build tableau
try:
    tab = stim.Tableau.from_stabilizers(pauli_strs, allow_underconstrained=True, allow_redundant=True)
    circuit = tab.to_circuit('elimination')
    print("Circuit generated successfully!")
    print(f"Circuit has {len(circuit)} instructions")
    
    # Save circuit
    with open("data/gpt5.2/agent_files/circuit_148.stim", "w") as f:
        f.write(str(circuit))
    print("Saved to circuit_148.stim")
except Exception as e:
    print(f"Error: {e}")
EOF
